css:
@font-face {
  font-family: 'Linter-UI-Plus';
  src: url('atom://linter-ui-plus/fonts/linter-ui-plus.woff') format('woff');
  font-weight: normal;
  font-style: normal;
}
.luip-icon::before {
  font-family: 'Linter-UI-Plus';
  font-weight: normal;
  font-style: normal;
  display: inline-block;
  line-height: 1;
  -webkit-font-smoothing: antialiased;
  text-decoration: none;
  text-rendering: optimizeLegibility;
}
.luip-icon-error::before {
  content: "\f026";
  color: #ff6347;
}
.luip-icon-warning::before {
  content: "\f02d";
  color: #e2c08d;
}
.luip-icon-info::before {
  content: "\f059";
  color: #6494ed;
}
.linter-ui-plus.status-bar .tile-error {
  color: #ff6347;
}
.linter-ui-plus.status-bar .tile-error::before {
  font-family: 'Linter-UI-Plus';
  font-weight: normal;
  font-style: normal;
  display: inline-block;
  line-height: 1;
  -webkit-font-smoothing: antialiased;
  text-decoration: none;
  text-rendering: optimizeLegibility;
}
.linter-ui-plus.status-bar .tile-error::before {
  content: "\f026";
  color: #ff6347;
}
.linter-ui-plus.status-bar .tile-warning {
  color: #e2c08d;
}
.linter-ui-plus.status-bar .tile-warning::before {
  font-family: 'Linter-UI-Plus';
  font-weight: normal;
  font-style: normal;
  display: inline-block;
  line-height: 1;
  -webkit-font-smoothing: antialiased;
  text-decoration: none;
  text-rendering: optimizeLegibility;
}
.linter-ui-plus.status-bar .tile-warning::before {
  content: "\f02d";
  color: #e2c08d;
}
.linter-ui-plus.status-bar .tile-info {
  color: #6494ed;
}
.linter-ui-plus.status-bar .tile-info::before {
  font-family: 'Linter-UI-Plus';
  font-weight: normal;
  font-style: normal;
  display: inline-block;
  line-height: 1;
  -webkit-font-smoothing: antialiased;
  text-decoration: none;
  text-rendering: optimizeLegibility;
}
.linter-ui-plus.status-bar .tile-info::before {
  content: "\f059";
  color: #6494ed;
}
.linter-ui-plus.status-bar .tile::before {
  font-size: 1.3em;
  vertical-align: middle;
  position: relative;
  top: -0.05em;
  margin-right: 0.15em;
  color: inherit;
}
.linter-ui-plus.status-bar .tile + .tile {
  margin-left: 0.4em;
}
.linter-ui-plus.status-bar .tile[data-count="0"] {
  color: inherit;
  opacity: 0.3;
}
